import Item from './Item';
import React from 'react';
const ItemList = ({productList}) => {
    return (
      <div className='wholeContainer'>  
      
      {productList.map( (product)=>(
      <Item key={product.id} product={product}/>
    ) )}
  
      </div>
    )
  }
  
  export default ItemList;
